function getSpanishPaginatorIntl() {
  const paginatorIntl = new MatPaginatorIntl();
  paginatorIntl.itemsPerPageLabel = "Elementos por p\xE1gina:";
  paginatorIntl.nextPageLabel = "P\xE1gina siguiente";
  paginatorIntl.previousPageLabel = "P\xE1gina anterior";
  paginatorIntl.firstPageLabel = "Primera p\xE1gina";
  paginatorIntl.lastPageLabel = "\xDAltima p\xE1gina";
  paginatorIntl.getRangeLabel = (page, pageSize, length) => {
    if (length === 0 || pageSize === 0) {
      return `0 de ${length}`;
    }
    const startIndex = page * pageSize;
    const endIndex = startIndex < length ? Math.min(startIndex + pageSize, length) : startIndex + pageSize;
    return `${startIndex + 1} - ${endIndex} de ${length}`;
  };
  return paginatorIntl;
}

